        <Toolbar>
        <Typography variant="h6" color="inherit" noWrap>
            To Do List
          </Typography>
          <Button color="inherit">Log Out</Button>
        </Toolbar>
      </AppBar>


      
      <main>
        {/* Hero unit */}
        <Box
          sx={{
            bgcolor: 'background.paper',
            pt: 8,
            pb: 6,
          }}
        >
          <Container maxWidth="sm">
            <Typography
              component="h1"
              variant="h2"
              align="center"
              color="text.primary"
              gutterBottom
